import React, { Component } from 'react';
import './code.css';


class practiceCode extends Component {
    render(){
        return (
            <div className='code'>
            <link href="https://cdn.quilljs.com/1.3.6/quill.snow.css" rel="stylesheet"></link>

              This is code page
            </div>
          );
        }
    }

export default practiceCode;
